function popDropDown(){
	var selectPlayer = document.getElementById("playerDropDown"); 
	for (const [key, value] of Object.entries(plyNorm)) {
	  if(key == 'abreb001')
	  	continue;
	  var el = document.createElement("option");
	  el.textContent = players[key];
	  el.value = key;
	  selectPlayer.appendChild(el);
	}

	selectPlayerChanged();
}

function selectPlayerChanged(){
	var selectPlayer = document.getElementById("playerDropDown");
	var selectPark = document.getElementById("parkDropDown"); 
	for (i = 0; i < selectPark.options.length; i++) {
	  selectPark.remove(i);
	}
	var player = selectPlayer.value;
	for (const [key, value] of Object.entries(CoHRE)) {
		if(value[player] != undefined){
			console.log(player)
			var el = document.createElement("option");
			el.textContent = parks[key];
			el.value = key;
			selectPark.appendChild(el);
		}
	}
	selectChanged();
}

function selectChanged(){
	var selectPlayer = document.getElementById("playerDropDown"); 
	var selectPark = document.getElementById("parkDropDown"); 
	park = selectPark.value;
	player = selectPlayer.value;
	console.log(CoHRE[park])
	if(park != "" && player != ""){
		if(CoHRE[park][player] != undefined){
			console.log("uh");
		document.getElementById("presults").innerHTML = players[player] + "'s CoHRE at " + parks[park] + " is " + CoHRE[park][player].toFixed(2) + ". What that means is that he would expect to get " + (CoHRE[park][player] * plyNorm[player]).toFixed(2) + " home runs at this park."
		document.getElementById("pnorm").innerHTML = "Normally, " + players[player] + " would be expected to get " + plyNorm[player].toFixed(2) + " Home Runs at a generic park. That means they score " + ((CoHRE[park][player] < 1) ? Math.abs((100 - (CoHRE[park][player] * 100) )).toFixed(2) +"% less" : Math.abs((100 - (CoHRE[park][player] * 100) )).toFixed(2) +"% more") + " home runs here than they would at a generic park."
		document.getElementById("pcompare").innerHTML = "At this park, the average player will get " + ((prkCoHRE[park] < 1) ? Math.abs((100 - (prkCoHRE[park] * 100) )).toFixed(2) +"% less" : Math.abs((100 - (prkCoHRE[park] * 100) )).toFixed(2) +"% more") + " home runs than at other parks."
		}
		else{
			document.getElementById("presults").innerHTML = "We do not have data on this player at this park."
			document.getElementById("pnorm").innerHTML = ""
			document.getElementById("pcompare").innerHTML = ""
		}
	}
}

window.onload = popDropDown;